import {connect} from 'react-redux';
import '../css/createPosts.css'



function SavedPosts(props) {

   const {text,userName} = props;
   let arr = [text,userName];
    return (
        <div>
            <div>
            {arr.map(user => 
                <div style={{width:'20rem',height:'10rem',backgroundColor:'gray'}}>
                <div class="card" style={{width: "18rem"}}>
                 <h3>{user.userName}</h3>
                 <div class="card-body">
                    <p class="card-text">{user.text}</p>
                 </div>
                </div>
                </div>
            )}
            </div>
        </div>        
    )   
}





export default SavedPosts;
